var timeTrackingDashboard=new Vue({el:"#app",data:{data:"",daily:!0,weekly:!1,monthly:!1},methods:{async json(){await this.promise().then(()=>fetch("json/data.json")).then(e=>e.json()).then(e=>this.data=e)},promise:()=>new Promise(e=>setTimeout(()=>e(),0)),log:e=>console.log(e),toggleTimeframes(){this.daily=this.weekly=this.monthly=!1,this[event.target.innerText.toLowerCase()]=!0}},async created(){await this.json()},async mounted(){}});